import { AndroidOutlined, EmailOutlined, Phone } from '@material-ui/icons';
import React from 'react';
import VPForm from './VPForm';
import "./ContactUs.css";
import PagesHero from './PagesHero';

function ContactUs() {
    return (
        <div>
        <PagesHero />
        <div className="contact_us">
            <div className="contact_us_flex">
                <VPForm />
                <div className="contact_us_info">
                    <p>Phone</p>
                    <Phone /><a href="tel:1234561235">(123)-456-1235</a>
                    <p>Mobile</p>
                    <AndroidOutlined /><a href="tel:1234561235">(123)-456-1235</a>
                    <p>Email</p>
                    <EmailOutlined /><a href="mailto:example@gmail.com">example@gmail.com</a>
                    <p>Address</p>
                    <p>2030 Lorem Ave, Lorem Circle, FL 12345</p>

                </div>
            </div>
        </div>
        </div>
    )
}

export default ContactUs
